#include <iostream>
#include <vector>
#include <array>
#include <algorithm>
#include <unordered_set>
#include <string>

using namespace std;

class Solution {
public:
    bool hasValidPath(vector<vector<char>>& grid) {
        vector<array<int,3>> arr;
        if(grid[0][0]==')' || (grid.size()+grid[0].size())%2==0)return false;
        arr.push_back({0,0,1});
        unordered_set<string> done;
        done.insert("0_0_1");
        int maxLen = grid.size()+grid[0].size()-1;
        while(!arr.empty())
        {
            auto tmp = arr.back();
            arr.pop_back();
            if(tmp[0]+1<grid.size())
            {
                int x = tmp[0]+1, y = tmp[1], stackScore = tmp[2]+(grid[x][y]==')'?-1:1);
                if(stackScore>=0 && stackScore <=maxLen/2 && done.find(to_string(x)+"_"+to_string(y)+"_"+to_string(stackScore))==done.end())
                {
                    arr.push_back({x,y,stackScore});
                    done.insert(to_string(arr.back()[0])+"_"+to_string(arr.back()[1])+"_"+to_string(arr.back()[2]));        
                    if(x == grid.size()-1 && y==grid[0].size()-1 && stackScore==0)return true;
                }
            }
            if(tmp[1]+1<grid[0].size())
            {
                int x = tmp[0], y = tmp[1]+1, stackScore = tmp[2]+(grid[x][y]==')'?-1:1);
                if(stackScore>=0 && stackScore <=maxLen/2 && done.find(to_string(x)+"_"+to_string(y)+"_"+to_string(stackScore))==done.end())
                {
                    arr.push_back({x,y,stackScore});
                    done.insert(to_string(arr.back()[0])+"_"+to_string(arr.back()[1])+"_"+to_string(arr.back()[2]));        
                    if(x == grid.size()-1 && y==grid[0].size()-1 && stackScore==0)return true;    
                }
            }
            // cout<<arr.back()[0]<<' '<<arr.back()[1]<<' '<<arr.back()[2]<<'\n';
        }
        return false;
    }
};

